import React,{useEffect, useState} from 'react'

export default function TableData(props) {
  const {data} = props;

  return (
    <>
      {data.map((row) => {
        <tr>
          {row.map((value)=> <td>{value}</td>)}
        </tr>
      })}
    </>
  )
}
